import AESFileEncryptor from './components/AESFileEncryptor';

export default function AESPage() {
  return (
    <div className="container mt-4">
      <h1 className="text-light">AES - Advanced Encryption Standard</h1>
      <p className="text-secondary text-center">
        AES is a symmetric cipher used for secure data encryption. This uses a 16-character key for 128-bit encryption.
      </p>

      <hr />
      <h4 className="text-info">üîê File Encryption & Decryption (Binary-Safe)</h4>
      <AESFileEncryptor />
    </div>
  );
}
